import React from 'react';
import '../styles/Footer.css';

const footerProducts = [
  { id: 1, name: 'Denim Jacket', price: '$45' },
  { id: 2, name: 'Sneakers', price: '$60' },
  { id: 3, name: 'Backpack', price: '$35' },
  { id: 4, name: 'Cap', price: '$15' },
  { id: 5, name: 'Sunglasses', price: '$25' },
  { id: 6, name: 'Hoodie', price: '$40' },
  { id: 7, name: 'Jeans', price: '$50' },
  { id: 8, name: 'T-Shirt', price: '$20' },
];

const Footer = () => (
  <footer className="footer">
    <h2>More from Our Store</h2>
    <div className="footer-products">
      {footerProducts.map(product => (
        <div className="footer-product" key={product.id}>
          <img src="https://via.placeholder.com/150" alt={product.name} />
          <h3>{product.name}</h3>
          <p>{product.price}</p>
        </div>
      ))}
    </div>
    <p className="footer-bottom">Â© 2025 Ayush Clothing Co. All rights reserved.</p>
  </footer>
);

export default Footer;
